radios5 = document.getElementsByName("fonttype"); // wijzig naar button
for (var i = 0, max = radios5.length; i < max; i++) {
  radios5[i].onclick = function() {
    var activeObject = canvas.getActiveObject();
    if (document.getElementById(this.id).checked == true) {
      if (this.id == "text-cmd-bold") {
        activeObject.set("fontWeight", "bold");
      }
      if (this.id == "text-cmd-italic") {
        activeObject.set("fontStyle", "italic");
      }



    } else {
      if (this.id == "text-cmd-bold") {
        activeObject.set("fontWeight", "");

      }
      if (this.id == "text-cmd-italic") {
        activeObject.set("fontStyle", "");

      }

    }


    canvas.renderAll();
  }
}

// grouping
document.getElementById("group").addEventListener("click", function() {
    if (!canvas.getActiveObject()) {
      return;
    }
    if (canvas.getActiveObject().type !== 'activeSelection') {
      return;
    }
    canvas.getActiveObject().toGroup();
    canvas.requestRenderAll();
});
  
// ungrouping
document.getElementById("ungroup").addEventListener("click", function() {
    if (!canvas.getActiveObject()) {
      return;
    }
    if (canvas.getActiveObject().type !== 'group') {
      return;
    }
    canvas.getActiveObject().toActiveSelection();
    canvas.requestRenderAll();
});




canvas.renderAll();

// Upload image
document.getElementById('uploadImageInput').onchange = function uploadImage(e) {
    let reader = new FileReader();
      reader.onload = function (event){
        let imgObj = new Image();
        imgObj.src = event.target.result;
        imgObj.onload = function () {
            let image = new fabric.Image(imgObj);
            canvas.centerObject(image);
            canvas.add(image);
            canvas.renderAll();
        }
    }
    reader.readAsDataURL(e.target.files[0]);
}


// Download the Canvas as PNG.
document.getElementById("downloadCanvas").addEventListener("click", function () {
    // Removing Selection
    removeSelection();
    // Name of the file/card
    let cardName = document.getElementById("cardName").value;
    // Referencing the canvas
    let canvas = document.getElementById("canvas");
    canvas.click();
    let image = canvas.toDataURL("image/png").replace("image/png", "image/octet-stream");
    let link = document.createElement('a');
    link.download = `${cardName}.png`;
    link.href = image;
    link.click();
});